import React from 'react';
import './Tile.css';

interface Props {
    image?: string;
    number: number;
}

export default function Tile({number, image}: Props) {
    if(number % 2 === 0) {
        return(
        <div className='black-tile'>
            <img src={image}/>
        </div>
        );
    } else {
        return(
        <div className='white-tile'>
            <img src={image}/>
        </div>
        );   
    }
}
